import Header from "./Components/Layout/Header/Header";
import Meals from "./Components/Meals/Meals";
import Cart from './Components/Cart/Cart';
import { useState } from "react";

function App() {
  const[disabled, setDisabled] = useState(true);

  return (
    <>
      {!disabled && <Cart/>}
      <Header />
      <main>
        <Meals />
      </main>
    </>
  );
}

export default App;
